import { BrowserRouter, Route, Routes } from 'react-router-dom';
import TaskForm from './taskForm';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import CreateTask from './CreateTask';
import EditTask from './EditTask';
import ViewTask from './ViewTask';
import './App.css';
import { FaPlus, FaTrash, FaEdit } from "react-icons/fa";


function App() {
  return (
    <>
    <nav class="navbar navbar-dark bg-primary">
        <a class="navbar-brand" href="/">Task Manager</a>
    </nav>
    <ul class="list-group list-group-flush">
  <li class="list-group-item"><a class="navbar-brand" href="/task/view/1">View Task</a></li>
  <li class="list-group-item"><a class="navbar-brand" href="/task/edit/1">Edit Task</a></li>
  <li class="list-group-item"><a class="navbar-brand" href="/task/create">Create Task</a></li>

</ul>
    <BrowserRouter>
      <Routes>
          <Route path="/" element={<TaskForm/>}> </Route>
          <Route path="/task/create" element={<CreateTask/>}> </Route>
          <Route path="/task/edit/:taskid" element={<EditTask/>}> </Route>
          <Route path="/task/view/:taskid" element={<ViewTask/>}> </Route>
      </Routes>
    </BrowserRouter>

    </>);
}

export default App;
